import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import CustomerList from './components/CustomerList';
import CustomerProfile from './components/CustomerProfile';
import UpdateCustomer from './components/UpdateCustomer';
import CustomerForm from './components/CustomerForm';

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/customers" exact component={CustomerList} />
          <Route path="/customers/:id" exact component={CustomerProfile} />
          <Route path="/customers/update/:id" exact component={UpdateCustomer} />
          <Route path="/customers/create" exact render={(props) => (
            <CustomerForm {...props} onSubmit={() => props.history.push('/customers')} />
          )} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
